import { BrowserRouter, Link, Route, Routes } from 'react-router-dom';
import './App.css';
import { Login } from './components/Login/Login';
import Register from './components/Register/Register'
import {Admin} from './components/Home/Admin'
import {User}from './components/Home/User'
import {Driver} from  './components/Home/Driver'
import {useSelector} from 'react-redux'
function App() {

  const loggeduser=useSelector(state=>state.authentic.loggeduser);
  const token=useSelector(state=>state.authentic.token);
  return (
    <div className="App">
     <BrowserRouter>

     <Routes>
       {token && loggeduser.role_id===1?<Route path="/admin/home" element={<Admin/>}/>:<Route path="/" element={<Login/>}/>}
        {token && loggeduser.role_id===2?<Route path="/driver/home" element={<Driver/>}/>:<Route path="/" element={<Login/>}/>}
        {token&&loggeduser.role_id===3?<Route path="/user/home" element={<User/>}/>:<Route path="/" element={<Login/>}/>}
        <Route path='/register' element={<Register/>}/>
        <Route exact path='' element={<Login/>}/>
        <Route exact path='/login' element={<Login/>}/>
        <Route exact path='/' element={<Login/>}/>
     </Routes>
     </BrowserRouter>
    </div>
  );
}

export default App;
